#include <string>
#include <cmath>

class Solution {
public:
    long long numberOfPowerfulInt(long long start, long long finish, int limit, std::string s) {
        long long count = 0;
        long long sVal = std::stoll(s);
        long long minLength = s.size();
        long long sPower = std::pow(10, minLength);

        for (long long prefix = 0; prefix < sPower; prefix++) {
            long long num = prefix * sPower + sVal;
            if (num > finish) break; // If number exceeds finish, no further valid numbers can be found.
            if (num >= start && num <= finish && isValid(num, limit)) {
                count++;
            }
        }

        return count;
    }

private:
    bool isValid(long long num, int limit) {
        while (num > 0) {
            if (num % 10 > limit) return false;
            num /= 10;
        }
        return true;
    }
};
